import React from "react";
import { Routes, Route, Navigate } from "react-router-dom"; // Make sure to import Route and Navigate

import Main from "./components/Mainhome";
import Signup from "./components/Signup";
import Login from "./components/Login";
import PrivateRoute from "./PrivateRoute";

function App() {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/signup" element={<Signup />} />
      <Route path="/login" element={<Login />} />

      {/* Private Route */}
      {/* <PrivateRoute path="/" element={<Main />} /> */}
      <Route path="/" element={<PrivateRoute><Login /></PrivateRoute>} />
    </Routes>
  );
}

export default App;
